import Select from 'react-select'
import '../styles/theme.css'

const FormSelect = ({className, defaultValue, options, styles}) => (
  <Select
    className={className}
    defaultValue={defaultValue}
    options={options}
    styles={{
      borderColor: '#DEDCE5',
      borderBottomWidth: '3px',
    }}
  />
);

export default FormSelect;
